import {
    Nav,
    NavMenu,
    Logo,
    MenuItem
} from './styled';

import { Link } from 'react-router-dom'

const NavBar = () => {



    return (
        <>
            <Nav>

                <Logo>dimitri.finger</Logo>
                <NavMenu>
                    <Link to='/home'>Teste</Link>
                    <Link to='/home'>Teste</Link>

                </NavMenu>
            </Nav>
        </>
    )
}

export default NavBar
